webpackJsonp([0x9f55dc7019c1],{822:function(e,o){e.exports={data:{markdownRemark:{html:'<h1 id="createcontainer"><a href="#createcontainer" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>createContainer</h1>\n<p><code class="language-text">createContainer</code> makes a container component with multiple behaviors. It allows you to effectively\ncombine any two of the following containers: <code class="language-text">VictoryBrushContainer</code>,\n<code class="language-text">VictoryCursorContainer</code>, <code class="language-text">VictorySelectionContainer</code>, <code class="language-text">VictoryVoronoiContainer</code>, or <code class="language-text">VictoryZoomContainer</code>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token keyword">const</span> VictoryZoomVoronoiContainer <span class="token operator">=</span> <span class="token function">createContainer</span><span class="token punctuation">(</span><span class="token string">"zoom"</span><span class="token punctuation">,</span> <span class="token string">"voronoi"</span><span class="token punctuation">)</span><span class="token punctuation">;</span></code></pre>\n      </div>\n<h2 id="arguments"><a href="#arguments" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Arguments</h2>\n<p>The function takes two <code class="language-text">behavior</code> arguments as strings:</p>\n<div class="gatsby-highlight">\n      <pre class="language-js"><code class="language-js"><span class="token function">createContainer</span><span class="token punctuation">(</span>behaviorA<span class="token punctuation">,</span> behaviorB<span class="token punctuation">)</span></code></pre>\n      </div>\n<h3 id="behavior"><a href="#behavior" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Behavior</h3>\n<p>Each <code class="language-text">behavior</code> must be one of the following strings:\n<code class="language-text">&quot;brush&quot;</code>, <code class="language-text">&quot;cursor&quot;</code>, <code class="language-text">&quot;selection&quot;</code>, <code class="language-text">&quot;voronoi&quot;</code>, and <code class="language-text">&quot;zoom&quot;</code>.\nThe resulting container uses the events from both behaviors.\nFor example, if both behaviors use the click event (like zoom and selection) the combined container\nwill trigger both behaviorsâ€™ events on each click.</p>\n<p><strong>Note</strong>: Order of the behaviors matters in a few cases.\nIt is recommended to use <code class="language-text">&quot;zoom&quot;</code> before any other behaviors: for example,\n<code class="language-text">createContainer(&quot;zoom&quot;, &quot;voronoi&quot;)</code> instead of <code class="language-text">createContainer(&quot;voronoi&quot;, &quot;zoom&quot;)</code>.</p>\n<h3 id="example"><a href="#example" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Example</h3>\n<p>The following example creates a custom container that combines <code class="language-text">VictoryVoronoiContainer</code> and\n<code class="language-text">VictoryZoomContainer</code>. Hovering over the chart will use Voronoi to highlight data points,\nwhile scrolling and dragging will zoom and pan.</p>\n<pre class="pre"><code class="language-playground_norender">const VictoryZoomVoronoiContainer = createContainer(&quot;zoom&quot;, &quot;voronoi&quot;);\nconst data = range(100).map((x) =&gt; ({x, y: 100 + x + random(10)}));\n\nconst App = () =&gt; (\n  &lt;VictoryChart\n    containerComponent={\n      &lt;VictoryZoomVoronoiContainer\n        labels={(d) =&gt; `${d.x}, ${d.y}`}\n      /&gt;\n    }&gt;\n    &lt;VictoryScatter data={data} /&gt;\n  &lt;/VictoryChart&gt;\n);\n\nReactDOM.render(&lt;App/&gt;, mountNode);</code></pre>',frontmatter:{id:32,scope:["random","range"],title:"createContainer"},fields:{slug:"/docs/create-container/"}}},pathContext:{slug:"/docs/create-container/"}}}});
